import './Header.scss';

const Header = () => {
	return (
    <div className="wrapper-header">

			<div className="wrapper-info-chat">
				<span className="current-chat">
					State name chat
				</span>
				<span className="current-chat">
					quanity online
				</span>
			</div>


		</div>
	);
};

export default Header;
